import { useState } from 'react';

export default function Testing() {
  useState()
    function handle(e){
    
    e.preventDefault();

  }
  function image(e){
    setimage(e.target.files[0])
  }
    return (
    <>
    
    <form onSubmit={handle}>
        <input onChange={image} type="file" />
        <input type="submit" />
    </form>
    </>
  )
}
